CREATE DEFINER=`root`@`localhost` PROCEDURE `bpm_cancelar_aluno`(in user int, in i_id int, inout msg varchar(100) )
BEGIN
  DECLARE pode_cancelar INT;
  SET pode_cancelar = 0;

  START TRANSACTION;

  
  SELECT COUNT(*)
  INTO pode_cancelar
  FROM tab_aluno
  WHERE id=i_id and situacao=1;

  if user=1 then


   if pode_cancelar > 0 then
      update tab_aluno set situacao = 0 where id = i_id;
      set msg = 'Aluno cancelado com sucesso';
   else
      set msg = 'Aluno no pode ser cancelado';
   end if;

  else
     set msg = concat(concat('usurio: ',user),' no tem tem permissao para cancelar aluno');

  end if;


  COMMIT;

END ;;
