CREATE DEFINER=`root`@`localhost` PROCEDURE `contato_cancelar`(in user int, in i_id int, inout msg varchar(100) )
BEGIN
  DECLARE pode_cancelar INT;
  DECLARE situacao_contato INT;
  SET pode_cancelar = 0;

  START TRANSACTION;

  
  SELECT COUNT(*)
  INTO pode_cancelar
  FROM tab_permissao
  WHERE user_id = user and funcionalidade_id=4;


  if pode_cancelar = 0 then
     set msg = concat(concat('usurio: ',user),' no tem tem permissao para cancelar contato');

  else

      select situacao into situacao_contato from tab_contato where id = i_id;

      if situacao_contato = -1 then
         update tab_contato set situacao = -1 where id = i_id;
         set msg = 'Contato cancelado com sucesso';
      else
         set msg = 'Contato no pode ser cancelado';
      end if;

  end if;

  COMMIT;

END ;;
