CREATE DEFINER=`root`@`localhost` PROCEDURE `contato_expurgar`(in user int, in i_id int, inout msg varchar(500) )
BEGIN

  DECLARE pode_expurgar INT;

  SET pode_expurgar = 0;

  set  msg = concat( msg ,'REGRA[00005] Expugar Contato - ' );


  START TRANSACTION;

  
  SELECT COUNT(*)
  INTO pode_expurgar
  FROM tab_permissao
  WHERE user_id = user and funcionalidade_id=5;


  if pode_expurgar = 0 then
     set msg = concat( msg, concat( concat( 'usurio: ' , user),' no tem tem permissao para expurgar contato' ) );

  else

      SELECT COUNT(*)
      INTO pode_expurgar
      FROM tab_contato
      WHERE id = i_id and situacao=-1;

      if pode_expurgar then

      select count(*) into pode_expurgar from tab_pagamento where id = i_id;

      if pode_expurgar = 0 then


         SELECT COUNT(*)
         INTO pode_expurgar
         FROM tab_evento
         WHERE contato_id = i_id;

         if pode_expurgar = 0 then

            delete from tab_contato where id = i_id;
            set msg = concat( msg ,'Contato expurgado com sucesso.' );

         else

            set msg = concat( msg , 'Remova os evento para o contato.');

         end if;

      else

         set msg = concat( msg , 'Remova os pagamentos para o contato.');

      end if;


      else

      set msg = concat( msg , 'Contato deve est cancelado antes de expurgar.');

      end if;

  end if;

  COMMIT;

END ;;
