CREATE DEFINER=`root`@`localhost` PROCEDURE `conversaoRecursiva`(IN N bigint, OUT extenso varchar(255))
BEGIN
    DECLARE aux varchar(255);
    DECLARE aux2 varchar(255);
    if (N = 0) then
        select 'zero' into extenso;
    elseif (N between 1 and 19) then
        select valor into extenso from tab_unidade where id = N;
    elseif (N in (20, 30, 40, 50, 60, 70, 80, 90)) then
        select valor into extenso from dezena where id = floor(N / 10);
    elseif (N between 20 and 100 and N % 10 > 0) then
        call conversaoRecursiva(N % 10, aux);
        select concat (valor, ' e ', aux) into extenso from tab_dezena where id = floor(N / 10);
    elseif (N in (100, 200, 300, 400, 500, 600, 700, 800, 900)) then
        select concat(valor, ' ') into extenso from centena where id = floor(N / 100);
    elseif (N between 101 and 199) then
        call conversaoRecursiva(N % 100, aux);
        select concat(' cento e ', aux ) into extenso;
    elseif (N between 200 and 1000 and N % 10 > 0) then
        call conversaoRecursiva(N % 100, aux);
        select concat(valor, ' e ', aux) into extenso from tab_centena where id = floor(N / 100);
    elseif (N between 1000 and 999999) then
        call conversaoRecursiva(floor(N / 1000), aux);
        call conversaoRecursiva(N % 1000, aux2);
        select concat(aux, ' mil ', aux2) into extenso;
    elseif (N between 1000000 and 1999999) then
        call conversaoRecursiva(floor(N / 1000000), aux);
        call conversaoRecursiva(N % 1000000, aux2);
        select concat(aux, ' milho ', aux2) into extenso;
    elseif (N between 2000000 and 999999999) then
        call conversaoRecursiva(floor(N / 1000000), aux);
        call conversaoRecursiva(N % 1000000, aux2);
        select concat(aux, ' milhes ', aux2) into extenso;
    elseif (N between 1000000000 and 1999999999) then
        call conversaoRecursiva(floor(N / 1000000000), aux);
        call conversaoRecursiva(N % 1000000000, aux2);
        select concat(aux, ' bilho ', aux2) into extenso;
    elseif (N between 2000000000 and 999999999999) then
        call conversaoRecursiva(floor(N / 1000000000), aux);
        call conversaoRecursiva(N % 1000000000, aux2);
        select concat(aux, ' bilhes ', aux2) into extenso;
    else
        select 'valor deve ser menor que 1 trilho' into extenso;
    end if;
end ;;
DELIMITER ;
