  FROM tab_permissao
  WHERE user_id = user and funcionalidade_id=11;


  if pode_expurgar = 0 then
     set msg = concat( msg, concat( concat( 'usurio: ' , user),' no tem tem permissao para expurgar evento' ) );

  else

      SELECT COUNT(*)
      INTO pode_expurgar
      FROM tab_evento
      WHERE id = i_id and situacao=-1;

      if pode_expurgar then

      select count(*) into pode_expurgar from tab_pagamento where id = i_id;

      if pode_expurgar = 0 then


         SELECT COUNT(*)
         INTO pode_expurgar
         FROM tab_pagamento
         WHERE evento_id = i_id;

         if pode_expurgar = 0 then

            delete from tab_evento where id = i_id;
            set msg = concat( msg ,'Evento expurgado com sucesso.' );

         else

            set msg = concat( msg , 'Remova os pagamento para o evento.');

         end if;

      else

         set msg = concat( msg , 'Remova os pagamentos para o evento.');

      end if;


      else

      set msg = concat( msg , 'Evento deve est cancelado antes de expurgar.');

      end if;

