CREATE DEFINER=`root`@`localhost` PROCEDURE `gerar_parcelas`(in user int, in i_id int, inout msg varchar(500) )
BEGIN

  DECLARE pode_gerar INT;
  declare i int(2);
  declare d date;
  declare p decimal(10,2);
  declare vnumero_parcelas int(2);
  declare vdata_primeira date;
  declare vprimeira_paga int(1);
  declare vvalor decimal(12,2);
  declare vintervalo int(3);
  declare vsituacao int(1);
  declare vdata_pagamento date;

  SET pode_gerar = 0;

  set  msg = concat( msg ,'REGRA[00013] Gerar Parcelas  - ' );


  START TRANSACTION;

  
  SELECT COUNT(*)
  INTO pode_gerar
  FROM tab_permissao
  WHERE user_id = user and funcionalidade_id=13;


  if pode_gerar = 0 then
     set msg = concat( msg, concat( concat( 'usurio: ' , user),' no tem tem permissao para gerar parcelas' ) );

  else

      SELECT situacao  , valor, primeira_paga, intervalo, data_primeira, numero_parcelas
      INTO   pode_gerar, vvalor, vprimeira_paga, vintervalo, vdata_primeira, vnumero_parcelas
      FROM tab_evento
      WHERE id = i_id;

      if pode_gerar <> -1 then

            
            SELECT count(*)
            INTO pode_gerar
            FROM tab_pagamento
            WHERE evento_id = i_id;
            
            if pode_gerar = 0 then
          
                
                set i = 0;
                set p = vvalor / vnumero_parcelas;
                set d = vdata_primeira;
                
                
                while (i < vnumero_parcelas) do

                  
                  if vprimeira_paga=1 and i=1 then
                     set vsituacao = 1;
                     set vdata_pagamento=d;
                  else
                     set vsituacao = 0;
                     set vdata_pagamento = null;
                  end if;
                        
                  insert into tab_pagamento( evento_id, dataVencimento, dataPagamento,  valor, situacao, nome, info )
                    values ( i_id, d , vdata_pagamento,  p, vsituacao, 'p', 'p' );
                 
                  set i = i+1;

                  if vintervalo=30 then
                  set d = DATE_ADD( d , INTERVAL 1 MONTH);
                  else
                  set d = DATE_ADD( d , INTERVAL vintervalo DAY);
                  end if;

                 
                end while;


                set msg = concat( msg ,concat( i,' Parcelas geradas com sucesso.') );

            else
               set msg = concat( msg ,'Existem parcelas registradas para esse evento.' );
            end if;

      else

            set msg = concat( msg , 'Evento deve est aguardando ou confirmado.');

      end if;


  end if;

  COMMIT;

END ;;
