CREATE DEFINER=`root`@`localhost` PROCEDURE `pagamento_expurgar`(in user int, in i_id int, inout msg varchar(500) )
BEGIN

  DECLARE pode_expurgar INT;

  SET pode_expurgar = 0;

  set  msg = concat( msg ,'REGRA[00018] Expugar Pagamento  - ' );


  START TRANSACTION;

  
  SELECT COUNT(*)
  INTO pode_expurgar
  FROM tab_permissao
  WHERE user_id = user and funcionalidade_id=18;


  if pode_expurgar = 0 then
     set msg = concat( msg, concat( concat( 'usurio: ' , user),' no tem tem permissao para expurgar pagamento' ) );

  else

      SELECT situacao
      INTO pode_expurgar
      FROM tab_pagamento
      WHERE id = i_id;

      if pode_expurgar = -1 then

            delete from tab_pagamento where id = i_id;
            set msg = concat( msg ,'Pagamento expurgado com sucesso.' );

      else

            set msg = concat( msg , 'Pagamento deve est cancelado para expurgo.');

      end if;


  end if;

  COMMIT;

END ;;
